        received = []
        # Exact match
        for cb in self._exact.get(topic, []):
            cb(topic, message)
            received.append(cb)
        # Pattern match
        for pattern, callbacks in self._patterns.items():
            if self._match(pattern, topic):
                for cb in callbacks:
                    cb(topic, message)
                    received.append(cb)
